import React, { useState } from 'react'
import axios from 'axios'

const Index = () => {
    const [state,setState]=useState({})
  return (
    <div>
        <h1>hello</h1>
        <button onClick={()=>{
            axios.get('https://jsonplaceholder.typicode.com/posts').then((response)=>{
                console.log(response.data);
                
            })
        }}>click me</button>
    </div>
  )
}

export default Index
